const ProjectBoxRight = ({ x, y, text, backgroundImage}) => {
    return (
      <svg
        x={x} 
        y={y} 
        width="414" 
        height="268" 
        viewBox="0 0 414 268" 
        fill="none" 
        xmlns="http://www.w3.org/2000/svg"
        style={{ position: 'absolute', left: `${x}px`, top: `${y}px` }}
      >
        <defs>
            <pattern id="pattern0_9_1562" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlinkHref={backgroundImage} transform="matrix(0.000976562 0 0 0.00169148 0 -0.366039)" />
                <image width="1024" height="1024" xlinkHref={backgroundImage}/>        
            </pattern>
        </defs>
        <path d="M412.53 229.413V1H114.962L16.9 77.1377" stroke="#5D5C61" stroke-width="2"/>
        <path d="M98.7385 38.587L114.639 1" stroke="#5D5C61" stroke-width="2"/>
        <path d="M396.63 267L412.53 229.413" stroke="#5D5C61" stroke-width="2"/>
        <path d="M396.63 39.0688L412.53 1" stroke="#5D5C61" stroke-width="2"/>
        <path d="M396.63 267H1V114.725L99.0621 38.587H396.63V267Z" fill="url(#pattern0_9_1562)" fill-opacity="0.1" stroke="#5D5C61" stroke-width="2"/>
        <path d="M1 114.725L16.9 77.1377" stroke="#5D5C61" stroke-width="2"/>
        <text x="380" y="80" fill="black" text-anchor="end">{text}</text>
        {/* {techStacks.map((tech, index) => (
          <text key={index} x="20" y={170 + index * 20} fill="black">{tech}</text>
        ))} */}
      </svg>
    );
};

export default ProjectBoxRight;
